pInput = '\\\\'
pInput = pInput.split('\n')

def partOne():
    x = 1
    y = 1
    code = ''
    keypad = [['7','8','9'],['4','5','6'],['1','2','3']]

    for line in pInput:
        for c in line:
            if c == 'U' and y < 2:
                y += 1
            elif c == 'D' and y > 0:
                y -= 1
            elif c == 'R' and x < 2:
                x += 1
            elif c == 'L' and x > 0:
                x -= 1
        code += keypad[y][x]
    
    return code

def partTwo():
    x = 0
    y = 2
    code = ''
    keypad = [['D'],['A','B','C'],['5','6','7','8','9'],['2','3','4'],['1']]

    for line in pInput:
        for c in line:
            if c == 'U' and (x, y) not in [(0,4),(0,3),(0,2),(2,3),(4,2)]:
                if y >= 2:
                    x -= 1
                elif y < 2:
                    x += 1
                y += 1
            elif c == 'D' and (x, y) not in [(0,0),(0,1),(0,2),(2,1),(4,2)]:
                if y > 2:
                    x += 1
                elif y <= 2:
                    x -= 1
                y -= 1
            elif c == 'R' and (x, y) not in [(0,4),(2,3),(4,2),(2,1),(0,0)]:
                x += 1
            elif c == 'L' and (x, y) not in [(0,4),(0,3),(0,2),(0,1),(0,0)]:
                x -= 1
                    
        code += keypad[y][x]
    
    return code


print("Part One Answer: " + str(partOne()))
print("Part Two Answer: " + str(partTwo()))
